import Welcome from "./Wellcome";
import Test from "./Test";

export default [
  {
    path: "/",
    name: "Home",
    component: <Welcome />,
    testt: "Test",
  },
  {
    path: "/students",
    name: "Students",
    component: <Test t="Students" />,
    testt: "Test",
  },
  {
    path: "/professors",
    name: "Professors",
    component: <Test t="Professors" />,
    testt: "Test",
  },
  {
    path: "/courses",
    name: "Courses",
    component: <Test t="Courses" />,
    testt: "Test",
  },
  {
    path: "/exams",
    name: "Exams",
    component: <Test t="Exams" />,
    testt: "Test",
  },
];
